import React from 'react';
import Question from './Question';
import { getQuestionsByPage } from '../data/questions';

const TestPage = ({ page, answers, onAnswer }) => {
  const questions = getQuestionsByPage(page);

  return (
    <div>
      {questions.map((question, index) => (
        <Question
          key={question.id}
          question={question}
          questionNumber={((page - 1) * 9) + index + 1}
          selectedValue={answers[question.id]}
          onAnswer={(value) => onAnswer(question.id, value)}
        />
      ))}
    </div>
  );
};

export default TestPage;
